import React from 'react'
import PricingCard from './PricingCard';

const Pricing = () => {
  return (
    <div name='pricing' className='w-full h-fit text-white bg-gray-900'>
        <div className='flex flex-col items-center justify-center max-w-screen-xl mx-auto h-full px-3 py-12'>
            <div className='px-4 py-12 text-center'>
                <h2 className='text-5xl font-bold '>
                    pricing
                </h2>
                <p className='text-xl py-8 text-gray-500 '>
                  Chamber burden least is at tis a ungainly me. Here sent thinking then ungainly
                  the thinking it then just, nevermore the nevermore usby seeing bore. Came my
                  moment nothing a.
                </p>
            </div>

            <div className='grid md:grid-cols-2 '>
            {/*Pricing Card*/}
            <PricingCard prices='Hobby' dolar='55' features={[
              {
                id:1,
                title:'Feature One'
              },
              {
                id:2,
                title:'Feature Two'
              },
            ]}/>
            <PricingCard prices='Study' dolar='65'features={[
              {
                id:1,
                title:' # Feature One'
              },
              {
                id:2,
                title:' $ SFeature Three'
              },
            ]}/>
            <PricingCard prices='Intermedier' dolar='75' features={[
              {
                id:1,
                title:'Feature One'
              },
              {
                id:2,
                title:'Feature Two'
              },
              {
                id:3,
                title:'Feature Three'
              }
            ]}/>
            <PricingCard prices='Expert' dolar='85'/>
            {/*PricingCard End*/}
            </div>
        </div>
    </div>
  )
}

export default Pricing
